Creates fake constants that Pawndoc comments can be attached to in the first compilation phase, before the real macros are created. Macros can't have documentation comments, but why not? They need documenting...
Used internally as YSI_CONST_PAWNDOC.
This creates a static stock of the same name to attach the documentation to, before actually defining the macro.
#if defined MACRO_NAME
// `#define MACRO_NAME` exists previously, don't document it here.
_FIXES_HIDE_PAWNDOC(SIMILAR_NAME);
#else
// Doesn't exist. Document it and define it.
_FIXES_CONST_PAWNDOC(MACRO_NAME);
#define MACRO_NAME(%0) (%0)
#endif

Creates fake functions that Pawndoc comments can be attached to in the first compilation phase, before the real macros are created. Macros can't have documentation comments, but why not? They need documenting...
Used internally as YSI_FUNC_PAWNDOC.
This creates a native of the same name, then calls it from a special function (called PAWNDOC) with a state set to the name of this function, to avoid declaring multiple functions in the XML while ensuring that this fake function is in the XML. Natives aren't in the output unless they are called, but we don't have to call them correctly because the container function is never called. You do need a fallback version of `PAWNDOC` to catch all other state variations declared elsewhere in your script.
#if defined MACRO_NAME
// `#define MACRO_NAME` exists previously, don't document it here.
_FIXES_HIDE_PAWNDOC(SIMILAR_NAME);
#else
// Doesn't exist. Document it and define it.
_FIXES_FUNC_PAWNDOC(MACRO_NAME(parameters));
#define MACRO_NAME(%0) (%0)
#endif

remarks.code:
// GetVehicleRotation Created by IllidanS4
stock GetVehicleRotation(vehicleid, &Float:rx, &Float:ry, &Float:rz)
{
new Float:qw, Float:qx, Float:qy, Float:qz;
GetVehicleRotationQuat(vehicleid, qw, qx, qy, qz);
rx = asin((2 * qy * qz) - (2 * qx * qw));
ry = -atan2((qx * qz) + (qy * qw), 0.5 - (qx * qx) - (qy * qy));
rz = -atan2((qx * qy) + (qz * qw), 0.5 - (qx * qx) - (qz * qz));
}

member.remarks:
Useful macros:
// HOLDING(keys)
#define HOLDING(%0) ((newkeys & (%0)) == (%0))
// PRESSED(keys)
#define PRESSED(%0) (((newkeys & (%0)) == (%0)) && ((oldkeys & (%0)) != (%0)))
// PRESSING(keyVariable, keys)
#define PRESSING(%0,%1) (%0 & (%1))
// RELEASED(keys)
#define RELEASED(%0) (((newkeys & (%0)) != (%0)) && ((oldkeys & (%0)) == (%0)))

If hittype is:
- BULLET_HIT_TYPE_NONE: the fX, fY and fZ parameters are normal coordinates, will give 0.0 for coordinates if nothing was hit (e.g. far object that the bullet can't reach);
- Others: the fX, fY and fZ are offsets relative to the hitid.

Used to declare a special iterator function. Examples: iterfunc stock OnlyZero(cur)
{
if (cur == -1)
return 0;
return -1;
}
iterfunc stock AlsoOnlyZero[cellmin](cur)
{
if (cur == cellmin)
return 0;
return cellmin;
}
iterfunc stock OneToTen[cellmin](cur)
{
if (cur == cellmin)
return 1;
if (cur == 10)
return cellmin;
return cur + 1;
}
iterfunc stock OneToN(cur, n)
{
if (n < 1)
return -1;
if (cur == -1)
return 1;
if (cur == n)
return -1;
return cur + 1;
}

remarks.code:
// valstr fix by Slice
stock FIX_valstr(dest[], value, bool:pack = false)
{
// format can't handle cellmin properly
static const cellmin_value[] = !"-2147483648";
if (value == cellmin)
pack && strpack(dest, cellmin_value, 12) || strunpack(dest, cellmin_value, 12);
else
format(dest, 12, "%d", value), pack && strpack(dest, dest, 12);
}
#define valstr FIX_valstr
